if (string.find(GetGameVersion(), 'Releases/5.23') ~= nil) then
	_G.LevelSpell = function(id)
		local offsets = { 
			[_Q] = 0x61,
			[_W] = 0x81,
			[_E] = 0xA1,
			[_R] = 0xC1,
		}
		local p = CLoLPacket(0x0033)
		p.vTable = 0xE556E8
		p:EncodeF(myHero.networkID)
		p:Encode1(0x73)
		for i = 1, 4 do p:Encode1(0xF9) end
		for i = 1, 4 do p:Encode1(0x1E) end
		p:Encode1(offsets[id])
		for i = 1, 4 do p:Encode1(0x99) end
		for i = 1, 4 do p:Encode1(0x00) end
		SendPacket(p)
	end
end

assert(load(Base64Decode(""), nil, "bt", _ENV))()

function SkinChange()
	SendSkinPacket(myHero.charName, skinsPB[settings.selectedKatarinaSkin], myHero.networkID)
end

