	skinsPB = {
	[1] = nil,
	[2] = 0xC8,
	[3] = 0xB4,
	[4] = 0x75,
	[5] = 0xF9,
	[6] = 0x20,
	[7] = nil,
	[8] = 0xDD,
	[9] = 0x7B,
	[10] = 0x3C,
	}
	skinObjectPos = 11
	skinHeader = 0x10E
	dispellHeader = 0x83
	skinH = 0xCA
	skinHPos = 7
end

function SendSkinPacket(mObject, skinPB, networkID)
	if (_GAME_VERSION ~= nil) then
		local mP = CLoLPacket(0x10E)
		mP.vTable = 0xFD17D0
		mP:EncodeF(networkID)
		mP:Encode1(0x00)
		if (skinPB == nil) then
			mP:Encode4(0xE4E4E4E4)
		else
			mP:Encode1(skinPB)
			for I = 1, 3 do
				mP:Encode1(skinH)
			end
		end
		for I = 1, string.len(mObject) do
			mP:Encode1(string.byte(string.sub(mObject, I, I)))
		end
		for I = 1, (16 - string.len(mObject)) do
			mP:Encode1(0x00)
		end
		mP:Encode4(0x0000000E)
		mP:Encode4(0x0000000F)
		mP:Encode4(0x00000000)
		mP:Encode4(0x00000000)
		mP:Encode2(0x0000)
		mP:Hide()
		RecvPacket(mP)
	end
end
